import axios from "axios"

export const RegisterMe = (user) => {
    return new Promise((resolve, reject) => {
        var data = user
        axios.post("https://us-central1-designmocha-dev.cloudfunctions.net/api/signup", data)
        .then((res) => {
            resolve(res)
        })
        .catch((error) => {
            reject(error)
        })
    }) 
}
